import { IUser } from "@shared/interfaces"
import React from "react"
import { Table } from "antd"
import { useUsers } from "../hooks/useUsers"

export const UsersList = () => {
	const { data, isLoading } = useUsers({
		options: {
			page: 1,
			take: 10,
		},
	})
	console.log(data)
	const dataSource = data?.payload?.map((x: IUser) => ({
		name: x.name,
		email: x.name,
		address: x.name,
		phoneNumber: x.name,
		type: x.name,
	}))
	return <Table columns={columns} dataSource={dataSource} loading={isLoading} />
}

const columns = [
	{
		title: "Name",
		dataIndex: "name",
		key: "name",
	},
	{
		title: "Email",
		dataIndex: "email",
		key: "email",
	},
	{
		title: "Address",
		dataIndex: "address",
		key: "address",
	},
	{
		title: "phoneNumber",
		key: "phoneNumber",
		dataIndex: "phoneNumber",
	},
	{
		title: "Type",
		key: "type",
		dataIndex: "type",
	},
]
